INSERT INTO `questionsandanswers` (`Question`, `Answer`, `questionId`) VALUES
('How much wood could a woodchuck chuck if a woodchuck could chuck wood?', 'Woodchucks don''t chuck wood and won''t chuck wood.', 1),
('What language is this coded in?', 'Python', 2),
('How many hours are in a day?', '24', 3),
('In this work, the prostitute Bianca embroiders a handkerchief for a customer who makes promises of marriage to her. Roderigo lusts after the protagonist’s wife, who is married without Brabanzio’s knowledge. The antagonist of this work plots to make it appear that his general’s wife is unfaithful to him with Cassio and kills his own wife Emilia. The protagonist of this play kills himself after murdering Desdemona before learning that she was faithful and that it was all a plot concocted by Iago. For 10 points, name this play by Shakespeare about the title Christian Moor.', 'Othello ', 4),
('This term was defined as “man’s emergence from self-imposed tutelage” in an essay by Immanuel Kant. It lends its name to an era during which women often sponsored discussions called Salons. This term was applied to rulers such as Frederick the Great and Catherine the Great. Denis Diderot, who was the primary editor of the Encyclopedie, was a thinker during an era of this name, along with Baruch Spinoza and Montesquieu. For 10 points, identify this term from intellectual history referring to a time period in which the power of reason was applied to reform.', 'Enlightenment [accept word forms like enlightened or anything mentioning the concept of enlightenment] ', 5),
('This structure is often coated with a layer of oligosaccharide molecules on one side, and this structure is often surrounded by carbohydrate rich zones called glycocalyx [“gly-co-kal-ix”]. The amount of cholesterol in this structure is regulated by the temperature and maintains its fluidity. Integral and peripheral proteins are found on this structure, and this structure is described by the fluid mosaic model. It is composed of molecules with hydrophilic heads and fatty acid tails. For 10 points, identify this structure, a phospholipid bilayer that separates the insides of a cell from its surroundings.', 'cell membrane [accept plasma membrane; prompt on phospholipid bilayer before mentioned; do not accept “cell wall”]  ', 6),
('This architect designed houses for himself in Arizona and Wisconsin which he named Taliesin East and West. One of this man’s designs near the University of Chicago campus exemplifies the Prairie Style. He was commissioned by the Kaufmann family to build a house along a portion of Bear Run in Pennsylvania. This architect designed a museum with the intention that visitors view works of art as they make their way down a spiral staircase inside an inverted ziggurat. For 10 points, name this architect of Fallingwater and the Guggenheim Museum.', 'Frank Lloyd Wright ', 7),
('The institution defined by this document passed a law that called for the division of land north of the Ohio and east of the Mississippi river to be divided into predefined sizes and sold with a tax. The pitfalls of this document were highlighted when there was no centralized response to a Massachusetts rebellion. This document was created by the Second Continental Congress, which had earlier drafted the Declaration of Independence. For 10 points, name this first plan for government in the United States of America, which was replaced by the Constitution.', 'Articles of Confederation and Perpetual Union ', 8),
('This leader built a temple near Luxor that bears his name and contains the House of Life, an extensive library filled with works about this man. A statue of this ruler and his daughter Bentaneth appears at the Karnak temple, which he built along with his father Seti I.  To commemorate his supposed victory over Muwatallis and his army of Hittites at Kadesh, this man built the twin Abu Simbel temples, and he built a massive tomb for his favorite consort, Nefertari.  For 10 points, name this Egyptian New Kingdom pharaoh who is called “the Great.” ', 'Ramesses II [accept Ramesses the Great before mentioned] ', 9),
('The protagonist of this film believes his father has been killed after seeing a newspaper while Christmas shopping. That character attended the wedding of his sister, Connie, with his fiancée, Kay, where he told her about his father’s relationship with Luca Brasi. In this film, Jack Woltz refuses Tom Hagen’s request to star Johnny Fontane in a movie, but agrees to the request after waking up with his horses’s bloody head in his bed. Don promises to man someone “an offer he can’t refuse” in this movie. For 10 points, name this movie starring Marlon Brando as the head of the Corleone Mafia family.', 'The Godfather [do NOT accept The Godfather Part II or The Godfather Part III] ', 10),
('In this novel, Mr. Blum owns a delicatessen which Gus, Jack, and G.H. plan to rob. The state attorney Buckley and private investigator Britten fear the influence of communism after the protagonist of this work signs a ransom note “Red” and is visited by Jan while in jail. The protagonist of this novel bludgeoned Bessie to death and smothered the drunken Mary before burning her in a chimney. Mr. Dalton hires the protagonist of this novel as a chauffeur while simultaneously charging high rent to poor blacks. For 10 points, name this novel about the life of Bigger Thomas by Richard Wright.', 'Native Son', 11),
('One prominent member of this art movement created artwork that incorporated multiple media which he called “combines.” Robert Rauschenberg and Jasper Johns were members of this movement, and another artist created works using Ben-Day dots. That artist was Roy Lichtenstein. Another artist from this movement worked out of a studio he named “The Factory,” and made several depictions of Campbell’s soup cans. For 10 points, name this art movement of the mid 20th century whose members, such as Andy Warhol, depicted items from everyday life. ', 'pop-art', 12),
('This author wrote one work whose protagonist travels to Bouville to research the life of Marquis de Rollebon but ends up getting sick of the research. That character, Roquentin [“row-ken-teen”], makes a failed attempt at getting back with his lover Anny. The three central characters of this author’s most famous work force themselves to admit the real reason they have been sent to a windowless room after death. That play by this man features Inez, Estelle, and Garcin, who proclaims that “Hell is other people.” For 10 points, name this French existentialist author of Nausea and No Exit.', 'Jean-Paul Sartre', 13),
('A deviation from this equation leads to a compressibility factor that can be calculated by dividing the left side of this equation by its right side. This law assumes negligible molecule size and elastic collisions and is thus most applicable at high temperature and low pressure conditions and when its subject is monatomic, and the van der Waals equation modifies this law by including terms for the volume of particles and the intermolecular attractive forces. For 10 points, name this law which combines Boyle’s and Charles’ laws, which states that pV=nRT.', 'ideal gas law [prompt on Boyle’s law or Charles’ law before mentioned] ', 14),
('This religion makes heavy use of the Prayer of Saint Ephrem, and the sanctuary and the nave are separated by the iconostasis in its churches. The symbol of this religion depicts a vertical line intersected by two horizontal lines and one at an angle. The original use of the Hagia Sophia was as a church for this religion. This branch of Christianity was excommunicated for rejecting Pope Leo IX, which lead to the Great Schism. For 10 points, name this branch of Christianity led by the Patriarch of Constantinople, which is dominant in Greece and Russia.', 'Eastern Orthodoxy [accept Eastern Orthodox Church or the Eastern Catholic Orthodox Church] ', 15),
('In this conflict, Christian of Anhalt’s forces were defeated at the Battle of White Mountain, marking the end of the “Bohemian” period of this war.  The Holy Roman Emperor Ferdinand II tried to retroactively enforce the Peace of Augsburg and replace Protestant leaders in German states with Catholic leaders during this war.  Although the Protestant forces were victorious at the battle of Lutzen in this conflict, they lost their leader, Gustavus II Adolphus of Sweden. For 10 points, identify this war that was ended by the Peace of Westphalia and lasted from 1618 to 1648. ', 'Thirty Years War ', 16),
('One work by this composer features text from speeches of a certain American president. A highly patriotic work by this man was later reworked into his final symphony, his third. This composer of Lincoln Portrait wrote the score for a ballet which included sections such as “Saturday Night Waltz” and the “Hoe Down.” This composer was commissioned by Martha Graham to write a ballet set in Pennsylvania that includes variations on the Shaker hymn Simple Gifts. For 10 points, identify this composer of Rodeo and Appalachian Spring.', 'Aaron Copland ', 17),
('This author wrote one novel in which the protagonist’s mother warns him that she will kill herself if he marries the outcast Clara. The protagonist of this author’s most famous novel ignores Ogbuefi’s warnings and kills Ikemefuna, and later accidentally kills a boy at a funeral, for which he is banished from Umofia for seven years. That novel by this author of No Longer at Ease ends with both Nwoye changing his name to Isaac and converting to Christianity as well as Okonkwo hanging himself. For 10 points, name this Nigerian author of Things Fall Apart.', 'Chinua Achebe ', 18),
('This figure was cursed by Athena, who had an image of this figure on her aegis, and the giant Khrysaor and Pegasus emerged from this figure upon her death. This entity was the only mortal one among her sisters, Sthenno and Euryale. This figure’s killer eventually married Andromeda after acquiring Hermes’ winged shoes and Athena’s shield, which he used to avoid looking into this figure’s eyes. For 10 points, name this Gorgon who was killed by Perseus, could turn men into stone, and had snakes for hair.', 'Medusa ', 19),
('This monarch’s rule saw a rebellion led by Nana Sahib that began at Meerut and featured bloody incidents in Cawnpore and Lucknow. Besides the Sepoy revolt, another incident in this monarch’s reign saw Robert Peel resign and allowed Lord Palmerston to take power after this ruler refused to replace the predominantly Whig members of the bedchamber with Tories. The Second Reform Act, which granted enfranchisement to male members of the working class, was passed during this queen’s reign. For 10 points, name this queen, the wife of Prince Albert, who reigned for most of the 1800’s.', 'Queen Alexandrina Victoria I ', 20),
('These particles are produced by annihilation of electron-positron pairs at low energies, and this particle transfers energy to electrons in an elastic collision in an effect named for Compton. Einstein used the existence of this particle to explain an effect discovered by Hertz. This particle is the mediator of the electromagnetic interaction, and its energy is directly proportional to its frequency. The speed of this particle in a vacuum is denoted c and is approximately 3.00 x 10^8 [“3.00 times 10 to the 8th”] meters per second. For 10 points, name this particle, the quantum of light.', 'photons', 21),
('Hypabyssal types of these rocks form discordant dikes, while plutonic types form cordant laccoliths. Mafic types of these rocks, which contain relatively heavier elements and are exemplified by peridotite, are contrasted with their felsic types including rhyolite. One of these rocks that cools without forming crystals, obsidian, is an extrusive type of these rocks as is basalt, while granite is an extrusive one of these. For 10 points, name this type of rocks formed from magma, contrasted with sedimentary and metamorphic rocks.', 'igneous rocks ', 22),
('This politician defeated  the scandal-ridden Buz Lukens to win his first major political election. This man recently appointed Jeb Hensarling, Dave Camp, and Fred Upton to a special committee. First citing Republican debates and then a 6:30 vote, this leader rejected a request for Obama to address a joint session of Congress. This man proposed a budget solution that included no tax hikes and major spending cuts which was rejected by the Senate. He is noted for his tearful display of emotion after succeeding Nancy Pelosi in his highest office.  For 10 points, name this current Speaker of the House.', 'John Andrew Boehner [pronounced “bay-ner”] ', 23),
('In one novel by this author, Professor Lidenbrock goes on a voyage with Hans and Axel during which they see mastodons and giant mushrooms before being shot out of a volcano. This author wrote The Mysterious Island as a sequel to a work about Aronnax who goes in search of a giant underwater beast, but is brought on board a submarine. In another work by this man, Phileas Fogg buys an elephant to complete his trip on time. For 10 points, name this author of 20,000 Leagues Under the Sea, Journey to the Centre of the Earth, and Around the World in Eighty Days.', 'Jules Verne', 24),
('What school is called the Harvard of the Midwest?', 'Truman State University', 25);

